#include "showranks.h"

bool Settings::ShowRanks::enabled = false;

void ShowRanks::CreateMove(CUserCmd* cmd)
{
	if (!Settings::ShowRanks::enabled)
		return;

	if (!(cmd->buttons & IN_SCORE))
		return;

	float input[3] = { 0.f };
	if( MsgFunc_ServerRankRevealAll ){
		MsgFunc_ServerRankRevealAll(input);
	}
}

